const handleExport = (containerSelector) => {
    const element = document.querySelector(containerSelector);
    const clonedElement = element.cloneNode(true);

    const transformSelectsToText = () => {
        const originalSelects = element.querySelectorAll("select");
        const clonedSelects = clonedElement.querySelectorAll("select");

        originalSelects.forEach((originalSelect, index) => {
            const clonedSelect = clonedSelects[index];
            if (clonedSelect) {
                const selectedOptionText = originalSelect.options[originalSelect.selectedIndex].text;
                const textNode = document.createTextNode(selectedOptionText);
                clonedSelect.parentNode.replaceChild(textNode, clonedSelect);
            }
        });
    };

    const inputs = clonedElement.querySelectorAll("input");
    const selects = clonedElement.querySelectorAll("select");
    const buttons = clonedElement.querySelectorAll("button");
    const textareas = clonedElement.querySelectorAll("textarea");

    inputs.forEach(input => input.setAttribute("disabled", true));
    selects.forEach(select => select.setAttribute("disabled", true));
    buttons.forEach(button => button.setAttribute("disabled", true));
    textareas.forEach(button => button.setAttribute("disabled", true));

    transformSelectsToText();

    const base64Image = 'data:image/png;base64,';

    // Replace the image src with the Base64 data URI
    const img = clonedElement.querySelector('img');
    if (img) {
        img.src = base64Image;
    }

    const htmlString = `
        <html>
            <head>
                <link href='https://fonts.googleapis.com/css?family=Montserrat' rel='stylesheet'>
                <style>
                    body {
                        font-family: 'Montserrat' !important;
                        background-color: white;
                        color: black;
                        padding: 2rem;
                        margin: 0;
                        display: flex;
                        flex-direction: column;
                        align-items: center;
                        justify-content: center;
                        text-align: center;
                    }

                    text, button, input, select, textarea {
                        font-family: 'Montserrat' !important;
                    }

                    input[disabled], select[disabled], button[disabled], textarea[disabled] {
                        opacity: 1;
                        background-color: white;
                        color: #000;
                        border: 1px solid #ccc;
                    }

                    .status_td:not(.unsafe) {
                        background-color: rgb(182, 255, 148);
                        color: rgb(0, 161, 0);
                    }

                    .status_td.unsafe {
                        background-color: rgb(255, 214, 214);
                        color: rgb(255, 0, 0); 
                    }

                    .status_td.attention {
                        background-color: rgb(255, 233, 162);
                        color: rgb(121, 92, 0); 
                    }
                        
                    .status_td.hold {
                        background-color: rgb(206, 206, 206);
                        color: rgb(56, 56, 56); 
                    }

                    .report {
                        border-style: solid;
                        border-radius: 2rem;
                        padding: 1.5rem;
                        width: 60rem;
                    }

                    .tableInformation, .tableProgress, .tableStatus, .tableDetails{
                        border-color: black;
                        border-style: solid;
                        border-width: 0.1rem;
                        border-collapse: collapse;
                    }

                    .tableInformation {
                    width: 50%
                    }

                    .tableProgress, .tableStatus, .tableDetails {
                        width: 100%
                    }

                    .tableInformation th, .tableProgress th, .tableStatus thead tr:first-child, .tableDetails thead tr:first-child {
                        background-color: #ff00e3;
                        border-color: black;
                        font-weight: bolder;
                        border-style: solid;
                        border-width: 0.1rem;
                        color: white;
                    }

                    .tableStatus thead tr:last-child th, .tableDetails thead tr:last-child th {
                        border-color: black;
                        font-weight: bold;
                        border-style: solid;
                        border-width: 0.1rem;
                        background-color: #ffccf9;
                        font-weight: bold;
                        width: 10rem;
                        text-align: center;
                    }

                    .tableInformation tr td:first-child, .tableProgress tr td:first-child {
                        background-color: #ffccf9;
                        font-weight: bold;
                        width: 10rem;
                        text-align: left;
                    }

                    .tableInformation td, .tableProgress td, .tableStatus td, .tableDetails td {
                        border-color: black;
                        border-style: solid;
                        border-width: 0.1rem;
                        color: black;
                        padding: 0.2rem;
                        text-align: left;
                    }

                    .tableStatus td, .tableDetails td{
                        text-align: center;
                    }

                    .tableDetails td:nth-child(1){
                        width: 20%;
                    }

                    .tableDetails td:nth-child(2), .tableDetails td:nth-child(3){
                        width: 11%;
                    }

                    .tableInformation td, .tableInformation td input,
                    .tableProgress td, .tableProgress td textarea,
                    .tableStatus td, .tableStatus td textarea, .tableStatus td select,
                    .tableDetails td, .tableDetails input{
                        font-size: small;
                    }

                    .tableInformation td input, .tableStatus td select, .tableProgress td textarea, 
                    .tableStatus td textarea,
                    .tableDetails td textarea{
                        width: 12rem;
                        border-width: 0.1rem;
                        border-style: solid;
                        border-color: rgb(167, 167, 167);
                        border-radius: 0.4rem;
                        padding: 0.2rem;
                        transition: 0.2s;
                        outline: none;
                        font-size: small;
                        margin: 0.3rem;
                    }

                    .tableProgress td textarea, 
                    .tableStatus td textarea,
                    .tableDetails td textarea{
                        font-size: 0.8rem;
                    }

                    .tableStatus td select{
                        width: 9.5rem;
                    }

                    .tableProgress td textarea, .tableStatus td textarea, .tableDetails td textarea {
                        width: 98%;
                        resize: none;
                        margin: 0.1rem;
                        height: 2rem;
                    }

                    .tableStatus td textarea, .tableDetails td textarea{
                        width: 92%;
                        height: 3rem;
                    }

                    .tableDetails td textarea{
                        width: 95%;
                        height: 2rem;
                    }
                </style>
            </head>
            <body>
                ${clonedElement.outerHTML}
            </body>
        </html>
    `;
    const blob = new Blob([htmlString], { type: 'text/html' });
    const link = document.createElement('a');
    link.href = URL.createObjectURL(blob);
    link.download = 'relatorio.html';
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
};

export { handleExport }